import React, { Component } from "react";
import { AppBar, Toolbar, IconButton, Button } from "@material-ui/core";
import HomeIcon from "@material-ui/icons/Home";
import { withRouter } from "react-router-dom";
import { Form } from "react-bootstrap";
import { FormControl } from "@mui/material";
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { signout } from "../api";

export class AppNavBar extends Component {

    logoff() {
        signout();
        window.location.assign('http://localhost:3000/');
    }

    timeline() {
        window.location.assign('http://localhost:3000/timeline');
    }

    goToUpload() {
        this.props.history.push("/upload");
    }
    goToBlockExplorer() {
        window.location.assign('http://localhost:3000/');
    }
    goToVerify() {
        this.props.history.push("/verify");
    }

    render() {
        return (
            <AppBar style={{
                backgroundColor: "rgb(53, 110, 255)",
            }} position="static">
                <Toolbar>
                    <IconButton
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                    ></IconButton>
                    <HomeIcon
                        id="home"
                        onClick={() => {
                            this.goToUpload();
                        }}
                    />
                    <AccountCircleIcon id="home" />


                    <Button
                      id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToUpload();
                        }}
                    >
                        Upload 
                    </Button>{" "}
                    <Button
                    id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToVerify();
                        }}
                    >
                        Verify 
                    </Button>{" "}
                    <Button
                        id="history"
                        color="inherit"
                        onClick={() => {
                            this.goToBlockExplorer();
                        }}
                    >
                        {" "}
                     Explore{" "}
                    </Button>
                    <Button
                        id="singout"
                        color="inherit"
                        onClick={this.logoff}
                    >
                        {" "}
                     SignOut{" "}
                    </Button>
                    <Button
                        id="timeline"
                        color="inherit"
                        onClick={this.timeline}
                    >
                        {" "}
                     Timeline{" "}
                    </Button>
                </Toolbar>
            </AppBar>
        );
    }
}

export default withRouter(AppNavBar);
